// SPDX-License-Identifier: MIT
// https://docs.openzeppelin.com/contracts/4.x/wizard
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";

import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";


contract Paru721 is ERC721Upgradeable, ERC721URIStorageUpgradeable, ERC721EnumerableUpgradeable, AccessControlUpgradeable, PausableUpgradeable {
    using SafeMath for uint256;
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");
    string private _baseUri;


    function initialize(string memory _name, string memory _symbol, string memory _baseuri) external initializer {
        __ERC721Enumerable_init_unchained();
        __ERC721URIStorage_init_unchained();
        __ERC721_init_unchained(_name, _symbol);
        _setBaseURI(_baseuri); 
    }

    /**
     * @dev Mints a token to an address with a tokenURI.
     * @param _to address of the future owner of the token
     */
    function mintItem(address _to, string memory _uri) public {
        uint256 newTokenId = _getNextTokenId();
        _mint(_to, newTokenId);
        _setTokenURI(newTokenId, _uri);

        // approval
    }

    function _getNextTokenId() private view returns (uint256) {
        return totalSupply().add(1);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal whenNotPaused override(ERC721EnumerableUpgradeable, ERC721Upgradeable){
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) internal override(ERC721Upgradeable, ERC721URIStorageUpgradeable) {
        require(hasRole(BURNER_ROLE, _msgSender()));
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721Upgradeable, ERC721URIStorageUpgradeable) returns (string memory){
        return super.tokenURI(tokenId);
    }

    function _setBaseURI(string memory _baseuri) internal virtual {
        _baseUri = _baseuri;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseUri;
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721Upgradeable, AccessControlUpgradeable, ERC721EnumerableUpgradeable)
        returns (bool){
        return super.supportsInterface(interfaceId);
    }
}
